import { Box, Heading, Text, VStack } from '@chakra-ui/react';

const ChildView: React.FC = () => {
  return (
    <Box>
      <VStack spacing={4} align="stretch">
        <Heading size="lg">My Account</Heading>
        <Text>Welcome to your account! Here you can view your balance and recent transactions.</Text>
        {/* TODO: Add balance display and transaction history components */}
      </VStack>
    </Box>
  );
};

export default ChildView;
